import { CardMedia, Grid } from '@mui/material'
import React from 'react'
import { coop } from '../../data/Data'

function Cooperate() {
  return (
    <div>
      
        {coop.map((item, index)=> {
         
             <CardMedia
          sx={{
            height: {
              xs: 130,
              md: 200,
              lg: 250,
            },
          }}
          component="img"
          image={item.cover}
          alt={item.title}
          key={item.id}
        />
      
        })}
  
    
    </div>
  )
}

export default Cooperate
